import styles from "../styles/navbar.module.css";
import { Link } from "react-router-dom";

export const Navbar = () => {
  return (
    <div className={styles.leftDiv}>
      <Link to="/">
        <img
          alt=""
          src="https://ninjasfiles.s3.amazonaws.com/0000000000003454.png"
        />
      </Link>
    </div>
  );
};
